import React from 'react'
import reg from './registration.PNG'
const Projects = () => {
    return ( 
        <>
        <h1 className="text-center">Projects</h1>
        <div className="container">
            <hr className="" />
            <div className="row">
                <div className="col-6">
                    <img src={reg} alt="" className="" />
                </div>
            </div>
        </div>
        </>
     );
}
 
export default Projects;
